import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
        .then(result => {
            const infected = result.data;

            setData(infected);
        })

    return (
    <div>
        <h1>CORONA</h1>
    </div>
    );
}

export default App;
